import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
        <div className="App_Aside"></div>
        <div className="App_Form">
          <div className="PageSwitcher">
            <a href="#">Sign in</a>
            <a href="#" className="Page">Sign in</a>
          </div>
        </div>

    </div>
  );
}

export default App;
